import React from 'react';
import './App.css';

function Header() {
  return (
    <header>
     <div class ='top-box'>
      
      <ul className= "nav">
        <li href="" >Home</li>
        <li href="" >About</li>        
      {isLoggedIn ? (
        <li onClick={onLogoutClick}>Вийти</li>
      ) : (
        <li onClick={onLoginClick}>Увійти</li>
      )}

     
     </ul>
     
    </div>
    </header>
  );
}

export default Header;
